import React, {useState} from 'react';


function Todos() {
    const [ todos, setTodos ] = useState([
        { text: "lorem  ipsum1" },
        { text: "lorem  ipsum2" },
        { text: "lorem  ipsum3" },
        
    ]);

   
    const Todo = ({ todo }) => <div>{todo.text}</div>;
    
    {todos.map((todo, index) => (
        <Todo
            key={index}
            index={index}
            todo={todo}
        />
    ))}
    return Todo;
}


export default Todos;
